import React, { useEffect } from "react";
import axios from "axios";

import "./App.css";
import { Router } from "./Router";

// test1
//axios.defaults.withCredentials = true;

function App() {
  useEffect(() => {
    axiosTest();
  });

  const axiosTest = () => {
    axios
      .get("http://54.151.0.147:5050/")
      .then((res) => console.log(res.data))
      .catch((err) => console.log(err));
  };

  return (
    <div className="App">
      <Router />
    </div>
  );
}

export default App;
